  false,\n\t\"url\": null,\n\t\"notes\": \"Inventory of Mineral Properties in Chelan
  County, Washington, Report of Investigations 9. Since late in the last century reports
  dealing with mineral resources and individual mineral properties in many parts of
  Chelan County have been written and many of these have been published in technical
  papers, mining journals, and in the publications of several State and Federal agencies.
  This summary report is a compilation of all such information available to this office,
  with additional data obtained from field investigations. Sources of information
  have not been indicated for individual properties, but reference is here made to
  the bibliography on page 57 for such sources. It should be noted however, that the
  bibliography does not include references to articles in mining periodicals.\",\n\t\"license_title\":
